import {
  View,
  Text,
  ScrollView,
  TouchableOpacity,
  Image,
  ActivityIndicator,
  Modal,
} from "react-native";
import React, { useEffect, useState } from "react";
import { SafeAreaView } from "react-native-safe-area-context";
import { LinearGradient } from "expo-linear-gradient";
import { storeColors } from "../theme";
import GradientButton from "../components/gradientButton";
import { Feather, FontAwesome, AntDesign } from "@expo/vector-icons";
import { useIsFocused, useNavigation } from "@react-navigation/native";
import axios from "axios";
import { TextInput } from "react-native-gesture-handler";
import AsyncStorage from "@react-native-async-storage/async-storage";

export default function UserComplaint() {
  const [reports, setReports] = useState("");
  const isFocused = useIsFocused();
  const navigation = useNavigation();
  const [profile, setProfile] = useState("");

  async function getValueFromAsyncStorage() {
    try {
      const value = await AsyncStorage.getItem("id");
      if (value !== null) {
        axios
          .get(`/report/${value}`)
          .then((response) => {
            setReports(response.data);
          })
          .catch((error) => {
            console.log(error);
          });
      } else {
        await AsyncStorage.clear();
        navigation.navigate("Login");
      }
    } catch (error) {
      console.log(error);
    }
  }
  useEffect(() => {
    if (isFocused) {
      getValueFromAsyncStorage();
    }
  }, [isFocused]);

  if (!reports) {
    return (
      <View className="flex justify-center items-center w-full h-full z-40 absolute">
        <ActivityIndicator size="large" color="#0000ff" />
      </View>
    );
  }
  return (
    <LinearGradient
      colors={["rgba(58, 131, 244,0.4)", "rgba(9, 181, 211, 0.4)"]}
      className="w-full flex-1"
    >
      <SafeAreaView>
        <ScrollView showsVerticalScrollIndicator={false}>
          <View className="container">
            {/* categories */}
            <View className="mt-3 space-y-4">
              <Text
                style={{ color: storeColors.text }}
                className="ml-4 text-3xl font-bold"
              >
                Complaints
              </Text>
            </View>

            <View className="mt-3">
              {reports.map((item, index) => {
                let bg = "rgba(255,255,255,0.4)";

                return (
                  <View
                    style={{ backgroundColor: bg }}
                    className="mx-4 p-2 mb-2 flex-row rounded-3xl"
                    key={index}
                  >
                    <Image
                      source={{
                        uri: `data:image/png;base64,${item.labor.image}`,
                      }}
                      style={{ width: 80, height: 80 }}
                      className="rounded-2xl"
                    />
                    <View className="flex-1 flex  pl-3 space-y-3">
                      <Text
                        style={{ color: storeColors.text }}
                        className="font-semibold"
                      >
                        {item.labor.name}
                      </Text>
                      <Text
                        style={{ color: storeColors.text }}
                        className="text-gray-500"
                      >
                        {item.message}
                      </Text>

                      {item.response ? (
                        <Text
                          style={{ color: storeColors.text }}
                          className="text-gray-500"
                        >
                          {item.response}
                        </Text>
                      ) : (
                        <Text
                          style={{ color: storeColors.text }}
                          className="text-gray-500"
                        >
                          no reply
                        </Text>
                      )}
                    </View>
                  </View>
                );
              })}
            </View>
          </View>
        </ScrollView>
      </SafeAreaView>
    </LinearGradient>
  );
}
